from sympy import isprime, prime
def insert_zeros(n, k): return int(("0"*k).join(list(str(n))))
def a(n):
  pn, k = prime(n), 1
  while isprime(insert_zeros(pn, k)): k += 1
  return k - 1
print([a(n) for n in range(5, 92)]) # _Michael S. Branicky_, Jun 03 2021

